/* ==UserStyle==
@name         Roll20 - Dark Cobalt
@namespace    github.com/shevernitskiy/roll20darkcobalt
@homepageURL  https://github.com/shevernitskiy/roll20darkcobalt
@updateURL    https://raw.githubusercontent.com/shevernitskiy/roll20darkcobalt/master/roll20darkcobalt.user.css
@version      1.0.74
@author       shevernitskiy
@license      MIT
==/UserStyle== */

@-moz-document url-prefix("https://app.roll20.net/editor/")
{
  /* -------------------------------------------------------------------------- */
  /*                                Global Things                               */
  /* -------------------------------------------------------------------------- */
  :root {
    --color-bg-light: #242533;
    --color-bg-light-rgba: rgb(36, 37, 51, 0.95);
    --color-bg-dark: #1c1d28;
    --color-bg-medium: #21222f;
    --color-text-main: #fff;
    --color-border-light: #292b3b;
    --color-text-primary: #ecedf6;
    --color-text-secondary: rgba(236, 237, 246, 0.7);
    --color-text-disabled: #888994;
    --opacity-text-helper: 0.45;
    --color-button-main: #5b40f5;
    --color-button-hover: #4933c2;
    --color-button-main-tr: #5b40f5bf;
    --color-element-bg: #373a52;
    --color-floating-bar-bg: rgba(55, 58, 82, 0.9);
    --color-red: #f85212;
    --color-green: #78ff10ff;
    --color-blue: #0c8ce7;
    --color-yellow: #fc0;
    --color-player-progress: rgba(255, 204, 0, 0.6);
    --color-none: #0000;
    --font-number: 'Gitan', sans-serif;
    --font-primary: 'Gitan', sans-serif;
    --font-header: 'Gitan', sans-serif;
    --font-secondary: 'Gitan', sans-serif;
    --font-mono: 'Ubuntu Mono', monospace;
    --version: 'Dark Cobalt v1.0.74 \A ðŸ”—github.com/shevernitskiy/roll20darkcobalt';
    --anim-numbers: fadein cubic-bezier(0.8, 0, 0.9, 1) 0.7s;
    --anim-attack: slide-in-blurred-right 0.6s;
    --anim-damage: slide-in-blurred-top 0.5s;
    --anim-traits: bounceInLeft 1s;
    --anim-crit: text-flicker-in-glow 2s linear 1s both;
    --anim-spell: jackInTheBox 1s;
    --anim-simple: flipInY 1s;
    --anim-sheet: slide-in-right 0.5s cubic-bezier(0.25, 0.46, 0.45, 0.94) both;
  }

  /* normal */
  @font-face {
    font-family: 'Gitan';
    font-style: normal;
    font-weight: normal;
    src: url('https://shevernitskiy.github.io/store/fonts/Gitan/Gitan-Regular.otf') format('opentype');
  }
  @font-face {
    font-family: 'Gitan';
    font-style: normal;
    font-weight: bold;
    src: url('https://shevernitskiy.github.io/store/fonts/Gitan/Gitan-Bold.otf') format('opentype');
  }

  /* itaclic */
  @font-face {
    font-family: 'Gitan';
    font-style: italic;
    font-weight: normal;
    src: url('https://shevernitskiy.github.io/store/fonts/Gitan/Gitan-RegularItalic.otf') format('opentype');
  }
  @font-face {
    font-family: 'Gitan';
    font-style: italic;
    font-weight: bold;
    src: url('https://shevernitskiy.github.io/store/fonts/Gitan/Gitan-BoldItalic.otf') format('opentype');
  }

  /* ---------------------------------- Animation ----------------------------- */
  @keyframes fadein {
    from {
      opacity: 0;
    }

    to {
      opacity: 1;
    }
  }

  @keyframes slide-in-right {
    0% {
      -webkit-transform: translateX(1000px);
      transform: translateX(1000px);
      opacity: 0;
    }

    100% {
      -webkit-transform: translateX(0);
      transform: translateX(0);
      opacity: 1;
    }
  }

  @keyframes zoomInLeft {
    from {
      opacity: 0;
      transform: scale3d(0.1, 0.1, 0.1) translate3d(-1000px, 0, 0);
      animation-timing-function: cubic-bezier(0.55, 0.055, 0.675, 0.19);
    }

    60% {
      opacity: 1;
      transform: scale3d(0.475, 0.475, 0.475) translate3d(10px, 0, 0);
      animation-timing-function: cubic-bezier(0.175, 0.885, 0.32, 1);
    }
  }

  @keyframes flipInY {
    from {
      transform: perspective(400px) rotate3d(0, 1, 0, 90deg);
      animation-timing-function: ease-in;
      opacity: 0;
    }

    40% {
      transform: perspective(400px) rotate3d(0, 1, 0, -20deg);
      animation-timing-function: ease-in;
    }

    60% {
      transform: perspective(400px) rotate3d(0, 1, 0, 10deg);
      opacity: 1;
    }

    80% {
      transform: perspective(400px) rotate3d(0, 1, 0, -5deg);
    }

    to {
      transform: perspective(400px);
    }
  }

  @keyframes fadeInDown {
    from {
      opacity: 0;
      transform: translate3d(0, -100%, 0);
    }

    to {
      opacity: 1;
      transform: translate3d(0, 0, 0);
    }
  }

  @keyframes jackInTheBox {
    from {
      opacity: 0;
      transform: scale(0.1) rotate(30deg);
      transform-origin: center bottom;
    }

    50% {
      transform: rotate(-10deg);
    }

    70% {
      transform: rotate(3deg);
    }

    to {
      opacity: 1;
      transform: scale(1);
    }
  }

  @keyframes bounceInDown {
    from,
    60%,
    75%,
    90%,
    to {
      animation-timing-function: cubic-bezier(0.215, 0.61, 0.355, 1);
    }

    0% {
      opacity: 0;
      transform: translate3d(0, -60px, 0) scaleY(3);
    }

    60% {
      opacity: 1;
      transform: translate3d(0, 25px, 0) scaleY(0.9);
    }

    75% {
      transform: translate3d(0, -10px, 0) scaleY(0.95);
    }

    90% {
      transform: translate3d(0, 5px, 0) scaleY(0.985);
    }

    to {
      transform: translate3d(0, 0, 0);
    }
  }

  @keyframes backInRight {
    0% {
      transform: translateX(2000px) scale(0.7);
      opacity: 0.7;
    }

    80% {
      transform: translateX(0px) scale(0.7);
      opacity: 0.7;
    }

    100% {
      transform: scale(1);
      opacity: 1;
    }
  }

  @keyframes bounceInRight {
    from,
    60%,
    75%,
    90%,
    to {
      animation-timing-function: cubic-bezier(0.215, 0.61, 0.355, 1);
    }

    from {
      opacity: 0;
      transform: translate3d(3000px, 0, 0) scaleX(3);
    }

    60% {
      opacity: 1;
      transform: translate3d(-25px, 0, 0) scaleX(1);
    }

    75% {
      transform: translate3d(10px, 0, 0) scaleX(0.98);
    }

    90% {
      transform: translate3d(-5px, 0, 0) scaleX(0.995);
    }

    to {
      transform: translate3d(0, 0, 0);
    }
  }

  @keyframes bounceInLeft {
    from,
    60%,
    75%,
    90%,
    to {
      animation-timing-function: cubic-bezier(0.215, 0.61, 0.355, 1);
    }

    0% {
      opacity: 0;
      transform: translate3d(-3000px, 0, 0) scaleX(3);
    }

    60% {
      opacity: 1;
      transform: translate3d(25px, 0, 0) scaleX(1);
    }

    75% {
      transform: translate3d(-10px, 0, 0) scaleX(0.98);
    }

    90% {
      transform: translate3d(5px, 0, 0) scaleX(0.995);
    }

    to {
      transform: translate3d(0, 0, 0);
    }
  }

  @keyframes slide-in-blurred-right {
    0% {
      -webkit-transform: translateX(1000px) scaleX(2.5) scaleY(0.2);
      transform: translateX(1000px) scaleX(2.5) scaleY(0.2);
      -webkit-transform-origin: 0% 50%;
      transform-origin: 0% 50%;
      -webkit-filter: blur(40px);
      filter: blur(40px);
      opacity: 0;
    }

    100% {
      -webkit-transform: translateX(0) scaleY(1) scaleX(1);
      transform: translateX(0) scaleY(1) scaleX(1);
      -webkit-transform-origin: 50% 50%;
      transform-origin: 50% 50%;
      -webkit-filter: blur(0);
      filter: blur(0);
      opacity: 1;
    }
  }

  @keyframes slide-in-blurred-top {
    0% {
      -webkit-transform: translateY(-100px) scaleY(2.5) scaleX(0.2);
      transform: translateY(-100px) scaleY(2.5) scaleX(0.2);
      -webkit-transform-origin: 50% 0%;
      transform-origin: 50% 0%;
      -webkit-filter: blur(40px);
      filter: blur(40px);
      opacity: 0;
    }

    100% {
      -webkit-transform: translateY(0) scaleY(1) scaleX(1);
      transform: translateY(0) scaleY(1) scaleX(1);
      -webkit-transform-origin: 50% 50%;
      transform-origin: 50% 50%;
      -webkit-filter: blur(0);
      filter: blur(0);
      opacity: 1;
    }
  }

  @keyframes roll-in-blurred-left {
    0% {
      -webkit-transform: translateY(-300px) rotate(-720deg);
      transform: translateY(-300px) rotate(-720deg);
      -webkit-filter: blur(50px);
      filter: blur(50px);
      opacity: 0;
    }

    100% {
      -webkit-transform: translateY(0) rotate(0deg);
      transform: translateY(0) rotate(0deg);
      -webkit-filter: blur(0);
      filter: blur(0);
      opacity: 1;
    }
  }

  @keyframes focus-in-contract {
    0% {
      letter-spacing: 1em;
      -webkit-filter: blur(12px);
      filter: blur(12px);
      opacity: 0;
    }

    100% {
      -webkit-filter: blur(0px);
      filter: blur(0px);
      opacity: 1;
    }
  }

  @keyframes focus-in-expand-fwd {
    0% {
      letter-spacing: -0.5em;
      -webkit-transform: translateZ(-800px);
      transform: translateZ(-800px);
      -webkit-filter: blur(12px);
      filter: blur(12px);
      opacity: 0;
    }

    100% {
      -webkit-transform: translateZ(0);
      transform: translateZ(0);
      -webkit-filter: blur(0);
      filter: blur(0);
      opacity: 1;
    }
  }

  @keyframes shake-lr {
    0%,
    100% {
      -webkit-transform: rotate(0deg);
      transform: rotate(0deg);
      -webkit-transform-origin: 50% 50%;
      transform-origin: 50% 50%;
    }

    10% {
      -webkit-transform: rotate(8deg);
      transform: rotate(8deg);
    }

    20%,
    40%,
    60% {
      -webkit-transform: rotate(-10deg);
      transform: rotate(-10deg);
    }

    30%,
    50%,
    70% {
      -webkit-transform: rotate(10deg);
      transform: rotate(10deg);
    }

    80% {
      -webkit-transform: rotate(-8deg);
      transform: rotate(-8deg);
    }

    90% {
      -webkit-transform: rotate(8deg);
      transform: rotate(8deg);
    }
  }

  @keyframes text-flicker-in-glow {
    0% {
      opacity: 0;
    }

    10% {
      opacity: 0;
      text-shadow: none;
    }

    10.1% {
      opacity: 1;
      text-shadow: none;
    }

    10.2% {
      opacity: 0;
      text-shadow: none;
    }

    20% {
      opacity: 0;
      text-shadow: none;
    }

    20.1% {
      opacity: 1;
      text-shadow: 0 0 30px rgba(255, 255, 255, 0.25);
    }

    20.6% {
      opacity: 0;
      text-shadow: none;
    }

    30% {
      opacity: 0;
      text-shadow: none;
    }

    30.1% {
      opacity: 1;
      text-shadow: 0 0 30px rgba(255, 255, 255, 0.45), 0 0 60px rgba(255, 255, 255, 0.25);
    }

    30.5% {
      opacity: 1;
      text-shadow: 0 0 30px rgba(255, 255, 255, 0.45), 0 0 60px rgba(255, 255, 255, 0.25);
    }

    30.6% {
      opacity: 0;
      text-shadow: none;
    }

    45% {
      opacity: 0;
      text-shadow: none;
    }

    45.1% {
      opacity: 1;
      text-shadow: 0 0 30px rgba(255, 255, 255, 0.45), 0 0 60px rgba(255, 255, 255, 0.25);
    }

    50% {
      opacity: 1;
      text-shadow: 0 0 30px rgba(255, 255, 255, 0.45), 0 0 60px rgba(255, 255, 255, 0.25);
    }

    55% {
      opacity: 1;
      text-shadow: 0 0 30px rgba(255, 255, 255, 0.45), 0 0 60px rgba(255, 255, 255, 0.25);
    }

    55.1% {
      opacity: 0;
      text-shadow: none;
    }

    57% {
      opacity: 0;
      text-shadow: none;
    }

    57.1% {
      opacity: 1;
      text-shadow: 0 0 30px rgba(255, 255, 255, 0.55), 0 0 60px rgba(255, 255, 255, 0.35);
    }

    60% {
      opacity: 1;
      text-shadow: 0 0 30px rgba(255, 255, 255, 0.55), 0 0 60px rgba(255, 255, 255, 0.35);
    }

    60.1% {
      opacity: 0;
      text-shadow: none;
    }

    65% {
      opacity: 0;
      text-shadow: none;
    }

    65.1% {
      opacity: 1;
      text-shadow: 0 0 30px rgba(255, 255, 255, 0.55), 0 0 60px rgba(255, 255, 255, 0.35), 0 0 100px rgba(255, 255, 255, 0.1);
    }

    75% {
      opacity: 1;
      text-shadow: 0 0 30px rgba(255, 255, 255, 0.55), 0 0 60px rgba(255, 255, 255, 0.35), 0 0 100px rgba(255, 255, 255, 0.1);
    }

    75.1% {
      opacity: 0;
      text-shadow: none;
    }

    77% {
      opacity: 0;
      text-shadow: none;
    }

    77.1% {
      opacity: 1;
      text-shadow: 0 0 30px rgba(255, 255, 255, 0.55), 0 0 60px rgba(255, 255, 255, 0.4), 0 0 110px rgba(255, 255, 255, 0.2),
        0 0 100px rgba(255, 255, 255, 0.1);
    }

    85% {
      opacity: 1;
      text-shadow: 0 0 30px rgba(255, 255, 255, 0.55), 0 0 60px rgba(255, 255, 255, 0.4), 0 0 110px rgba(255, 255, 255, 0.2),
        0 0 100px rgba(255, 255, 255, 0.1);
    }

    85.1% {
      opacity: 0;
      text-shadow: none;
    }

    86% {
      opacity: 0;
      text-shadow: none;
    }

    86.1% {
      opacity: 1;
      text-shadow: 0 0 30px rgba(255, 255, 255, 0.6), 0 0 60px rgba(255, 255, 255, 0.45), 0 0 110px rgba(255, 255, 255, 0.25),
        0 0 100px rgba(255, 255, 255, 0.1);
    }

    100% {
      opacity: 1;
      text-shadow: 0 0 30px rgba(255, 255, 255, 0.6), 0 0 60px rgba(255, 255, 255, 0.45), 0 0 110px rgba(255, 255, 255, 0.25),
        0 0 100px rgba(255, 255, 255, 0.1);
    }
  }

  @keyframes tracking-in-contract-bck {
    0% {
      letter-spacing: 1em;
      -webkit-transform: translateZ(400px);
      transform: translateZ(400px);
      opacity: 0;
    }

    40% {
      opacity: 0.6;
    }

    100% {
      -webkit-transform: translateZ(0);
      transform: translateZ(0);
      opacity: 1;
    }
  }

  /* ---------------------------------- Fonts --------------------------------- */
  /* Ruda */
  /* cyrillic */
