@-moz-document url-prefix("https://app.roll20.net/editor/")
{
  /* -------------------------------- ELEMENTS -------------------------------- */
  /* Scrollbar */
  #editor-wrapper::-webkit-scrollbar,
  #rightsidebar .ui-tabs-panel::-webkit-scrollbar,
  textarea::-webkit-scrollbar {
    -webkit-appearance: none;
    width: 12px;
    height: 12px;
  }

  #editor-wrapper::-webkit-scrollbar-thumb,
  #rightsidebar .ui-tabs-panel::-webkit-scrollbar-thumb,
  textarea::-webkit-scrollbar-thumb {
    border-radius: 6px;
    border: 2px solid rgba(0, 0, 0, 0);
    background-color: rgba(0, 0, 0, 0.5);
  }

  #editor-wrapper::-webkit-scrollbar-corner,
  #rightsidebar .ui-tabs-panel::-webkit-scrollbar-corner,
  textarea::-webkit-scrollbar-corner {
    -webkit-box-shadow: inset 0 0 6px rgba(0, 0, 0, 0.3);
    box-shadow: inset 0 0 6px rgba(0, 0, 0, 0.3);
  }

  /* Buttons */
  .btn,
  .ui-dialog-buttonpane .ui-dialog-buttonset .ui-button {
    font-family: var(--font-primary);
    font-size: 17px;
    font-weight: 500;
    color: var(--color-text-primary);
    background: var(--color-button-main);
    background-image: none;
    text-shadow: none;
    border: 0px;
    border-radius: 4px;
    outline: none !important;
    transition: background 0.15s ease-out;
    -webkit-transition: background 0.15s ease-out;
    padding: 6px 12px;
  }

  .btn:hover,
  .btn:active,
  .btn:focus,
  .ui-dialog-buttonpane .ui-dialog-buttonset .ui-button:hover,
  .ui-dialog-buttonpane .ui-dialog-buttonset .ui-button:active,
  .ui-dialog-buttonpane .ui-dialog-buttonset .ui-button:focus {
    background: var(--color-button-hover);
    color: var(--color-text-primary);
  }

  a.btn {
    color: var(--color-text-primary) !important;
  }

  #jukebox .primarycontrols .btn,
  #jukebox .secondarycontrols .btn {
    background-image: none;
  }

  button.btn-primary {
    background-color: var(--color-red);
    text-shadow: 0px 0px 2px var(--color-bg-dark);
  }

  button.btn-primary:hover,
  button.btn-primary:active:hover,
  button.btn-primary:focus {
    background-color: var(--color-red);
    box-shadow: 0 0 5px var(--color-red);
  }

  /* Checkbox */
  input[type='checkbox'] {
    position: relative;
    cursor: pointer;
    margin: 2px;
  }

  input[type='checkbox']:before {
    content: '';
    display: block;
    position: absolute;
    width: 11px;
    height: 11px;
    top: 0px;
    left: 0px;
    background-color: var(--color-element-bg);
    border-radius: 0px;
    border: 2px solid var(--color-element-bg);
  }

  input[type='checkbox']:checked:before {
    content: '';
    display: block;
    position: absolute;
    width: 11px;
    height: 11px;
    top: 0px;
    left: 0px;
    background-color: var(--color-button-main);
    border-radius: 1px;
    border: 2px solid var(--color-button-main);
  }

  input[type='checkbox']:checked:after {
    content: '';
    display: block;
    width: 5px;
    height: 8px;
    border: solid var(--color-text-primary);
    border-width: 0 3px 3px 0;
    -webkit-transform: rotate(45deg);
    -ms-transform: rotate(45deg);
    transform: rotate(45deg);
    position: absolute;
    top: 0px;
    left: 3.5px;
  }

  /* Slider selector */
  input:checked + .slider {
    background-color: var(--color-button-hover) !important;
    box-shadow: 0px 0px 2px var(--color-button-hover) !important;
  }

  .slider:before {
    background-color: var(--color-yellow) !important;
  }

  .slider:after {
    color: var(--color-yellow) !important;
  }

  .slider {
    background-color: var(--color-bg-dark) !important;
  }

  /* Slider */
  .ui-slider {
    border: 1px solid var(--color-element-bg);
    background: var(--color-element-bg);
  }

  .ui-slider-horizontal {
    height: 5px;
  }

  .ui-slider-horizontal.ui-widget-content {
    background-color: var(--color-bg-dark) !important;
  }

  .ui-slider-horizontal:hover {
    box-shadow: 0 0 15px rgba(0, 0, 0, 0.5);
  }

  .ui-slider .ui-slider-handle {
    background-color: var(--color-button-main);
    background-image: none;
    box-shadow: 0px 0px 5px var(--color-text-disabled);
    border: 1px solid var(--color-button-main);
    border-radius: 6px;
    width: 12px;
    height: 12px;
  }

  /* Select */
  select {
    font-family: var(--font-primary);
    font-size: 16px;
    border-radius: 4px;
    border: 1px solid var(--color-border-light);
    background: var(--color-element-bg);
    color: var(--color-text-primary);
  }

  select:focus,
  input[type='text']:focus,
  .selectize-input:focus,
  .selectize-input.focus,
  textarea:focus {
    outline: none;
    border: 1px solid var(--color-yellow);
  }

  select[disabled] {
    background: var(--color-element-bg);
    border-radius: 4px;
    border: 1px solid var(--color-red);
    color: var(--color-red);
  }

  /* Input Text */
  input[type='text'],
  .selectize-input,
  .dialog select.chosen,
  textarea {
    color: var(--color-text-primary);
    background: var(--color-element-bg);
    font-family: var(--font-secondary);
    font-size: 15px;
    border: 1px solid var(--color-element-bg);
  }

  input[type='text']::placeholder,
  .selectize-input::placeholder,
  textarea::placeholder {
    color: var(--color-text-disabled);
  }

  .selectize-dropdown-content {
    border: 0px;
  }

  .selectize-dropdown-content .option.active {
    background: none;
    color: var(--color-yellow);
  }

  .selectize-control.multi .selectize-input > div.active {
    background: var(--color-button-main);
    color: var(--color-text-primary);
  }

  .chosen-container-active .chosen-choices li.search-field input[type='text'],
  .chosen-container .chosen-results {
    color: var(--color-text-primary) !important;
  }

  .chosen-container-multi .chosen-choices li.search-field input[type='text'],
  .chosen-container-multi .chosen-choices {
    color: var(--color-text-primary);
    background: var(--color-element-bg) !important;
    font-family: var(--font-secondary);
    font-size: 15px;
    border: 1px solid var(--color-element-bg);
    border-radius: 4px;
  }

  .chosen-container .chosen-drop {
    color: var(--color-text-primary) !important;
    background: var(--color-element-bg) !important;
    font-family: var(--font-secondary);
    border: 1px solid var(--color-element-bg);
    border-radius: 4px;
  }

