/* Script List Color, Size, Background, Outline */
ul.nav.nav-tabs {font-size: 18px; padding-bottom: 15px;}
ul.nav-tabs > li {line-height: normal; display: inline-block;}
ul.nav-tabs > li > a {display: inline-block; padding: 5px 5px 5px 5px; margin: 3px 2px; border-radius: 5px;}
ul.nav-tabs > li:nth-child(even):not(:first-child):not(:last-child) > a:not([class="disabled"]) {background-color: var(--primary-bg); border: 1px solid; border-color: var(--primary-border); color: var(--primary-text);}
ul.nav-tabs > li:nth-child(odd):not(:first-child):not(:last-child) > a:not([class="disabled"]) {background-color: var(--secondary-bg); border: 1px solid; border-color: var(--secondary-border); color: var(--secondary-text);}
ul.nav-tabs > li > a.disabled {background-color: var(--disabled-bg); border: 1px solid; border-color: var(--disabled-border); color: var(--disabled-text);}
ul.nav-tabs > li:first-child > a,
ul.nav-tabs > li:last-child > a {background-color: var(--scriptlibrary-bg); border: 1px solid; border-color: var(--scriptlibrary-border); color: var(--scriptlibrary-text);}
ul.nav-tabs > li.active > a {background-color: var(--active-bg) !important; border: 1px solid; border-color: var(--active-border) !important; border-radius: 5px; color: var(--active-text) !important;}
ul.nav-tabs > li:not([class="active"]) > a:hover {background-color: var(--hover-bg) !important; border: 1px solid; border-color: var(--hover-border) !important; border-radius: 5px; color: var(--hover-text) !important;}
